import styled from 'styled-components';

const App = styled.body`
  background-color: black;
  width: 100%;
  height: 100vh;
  overflow: hidden;
`;

const Layout = styled.div`
  margin: 0;
  padding: 0;
  color: #ffffff;
`;



export default () => {
  <App>

  </App>
};
